import React from 'react'

import styles from './SourceCode.module.css'

const SourceCode = () => {
    return (
        <div className={styles.source}>
                    <div className={styles.editors_container}>
                        <Editor
                        language="xml"
                        name="HTML"
                        value={html}
                        onChange={setHtml}
                        labelColor='#d94924'
                        icon={<SiHtml5 />}
                        />
                        
                        <Editor
                        language="css"
                        name="CSS"
                        value={css}
                        onChange={setCss}
                        labelColor='#5bb7ed'
                        icon={<SiCsswizardry/>}
                        />

                        <Editor
                        language="javascript"
                        name="JS"
                        value={js}
                        onChange={setJs}
                        labelColor='#e4d04b'
                        icon={<SiJavascript/>}
                        />
                    </div>
                    <div className={styles.result}>
                        <iframe
                        srcDoc={srcDoc}
                        title="output"
                        sandbox="allow-scripts"
                        frameBorder="0"
                        width="100%"
                        height="100%"
                        />
                    </div>
                </div>
    )
}

export default SourceCode
